import React from 'react';
import axios from 'axios';

const getData = () => {
  axios.get('https://jsonplaceholder.typicode.com/posts')
      .then(res => {
        const data = res.data;
        this.setState({ data });
      })
}

const Table = () => {
  return (
      <table>
        <thead>
        <tr>
          <th>User Id</th>
          <th>Id</th>
          <th>Title</th>
          <th>Body</th>
        </tr>
        </thead>
        <tbody>
        {this.state.data.map(post =>
            <tr key={post.id}>
              <td>{post.userId}</td>
              <td>{post.id}</td>
              <td>{post.title}</td>
              <td>{post.body}</td>
            </tr>
        )}
        </tbody>
      </table>
  )
}
